import "./App.css";
import { useState, useEffect } from "react";

function App() {
  const [display, setDisplay] = useState("");
  const [result, setResult] = useState(0);
  const [prevValue, setPrevValue] = useState(0);
  const [nextValue, setNextValue] = useState("");
  const [op, setOp] = useState(null);

  useEffect(() => {}, [op, nextValue, prevValue]);

  const CalculatorOperations = {
    "/": (firstValue, secondValue) => firstValue / secondValue,
    "*": (firstValue, secondValue) => firstValue * secondValue,
    "+": (firstValue, secondValue) => firstValue + secondValue,
    "-": (firstValue, secondValue) => firstValue - secondValue,
    "=": (firstValue, secondValue) => secondValue,
  };

  const performOperation = () => {
    let temp = CalculatorOperations[op](
      parseFloat(prevValue),
      parseFloat(nextValue)
    );
    setOp(null);
    setNextValue(String(temp));
    setPrevValue(null);
  };


  const handleClick = (value) => {
    if (Number.isInteger(value)) {
      handleNum(parseInt(value, 10));
    } else if (value in CalculatorOperations) {
      if (op === null) {
        setOp(value);
        setPrevValue(nextValue);
        setNextValue("");
      }
      if (op) {
        setOp(value);
      }
      if (prevValue && op && nextValue) {
        performOperation();
      }
    } else if (value === "AC") {
      clearData();
    } else if (value === "\xB1") {
      changeSign();
    } else if (value === ".") {
      insertDot();
    } else if (value === "%") {
      percentage();
    }


  };
  return (
    <div className="App">
      <div className="h-screen flex justify-center items-center flex-col bg-slate-100">
        <div className="bg-primary  h-auto w-1/5 border rounded-xl px-8 py-20">
          <h1 className="text-white font-bold text-3xl mb-4">{result}</h1>
          <div className="mb-4">
            <input
              type="text"
              className="text-white bg-transparent"
              value={display}
              onChange={(e) => setDisplay(e.target.value)}
            />
          </div>
          <hr className="border border-x border-stone-50 mb-4" />
          <div className="flex">
            <div className="flex flex-col justify-between items-center pt-4">
              <button
                className="bg-secondary py-2 px-3 mx-1 border-0 rounded-md text-white text-lg"
                onClick={() => handleClick(0)}
              >
                AC
              </button>
              <button
                className="text-white text-2xl"
                onClick={() => handleClick(7)}
              >
                7
              </button>
              <button
                className="text-white text-2xl"
                onClick={() => handleClick(4)}
              >
                4
              </button>
              <button
                className="text-white text-2xl"
                onClick={() => handleClick(1)}
              >
                1
              </button>
              <button
                className="text-white text-2xl"
                onClick={() => handleClick(0)}
              >
                0
              </button>
            </div>
            <div className="flex flex-col justify-between items-center pt-4">
              <button className="bg-secondary py-2 px-3 mx-1 border-0 rounded-md text-white text-lg">
                +/-
              </button>
              <button
                className="text-white text-2xl"
                onClick={() => handleClick(8)}
              >
                8
              </button>
              <button
                className="text-white text-2xl"
                onClick={() => handleClick(5)}
              >
                5
              </button>
              <button
                className="text-white text-2xl"
                onClick={() => handleClick(2)}
              >
                2
              </button>
              <button
                className="text-white text-2xl"
                onClick={() => handleClick(".")}
              >
                .
              </button>
            </div>
            <div className="flex flex-col justify-between items-center pt-4">
              <button
                className="bg-secondary py-2 px-3 mx-1 border-0 rounded-md text-white text-lg"
                onClick={() => handleClick("%")}
              >
                %
              </button>
              <button
                className="text-white text-2xl"
                onClick={() => handleClick(9)}
              >
                9
              </button>
              <button
                className="text-white text-2xl"
                onClick={() => handleClick(6)}
              >
                6
              </button>
              <button
                className="text-white text-2xl"
                onClick={() => handleClick(3)}
              >
                3
              </button>
              <button
                className="text-white text-2xl"
                onClick={() => handleClick("00")}
              >
                00
              </button>
            </div>
            <div className="flex flex-col justify-between items-center pt-4">
              <button
                className="bg-secondary py-2 px-4 border-0 rounded-md text-white text-2xl mb-2"
                onClick={() => handleClick("/")}
              >
                /
              </button>
              <button
                className="bg-secondary py-1 px-4 border-0 rounded-md text-white text-2xl mb-2"
                onClick={() => handleClick("*")}
              >
                *
              </button>
              <button
                className="bg-secondary py-1 px-4 border-0 rounded-md text-white text-2xl mb-2"
                onClick={() => handleClick("+")}
              >
                +
              </button>
              <button
                className="bg-secondary py-1 px-4 border-0 rounded-md text-white text-2xl mb-2"
                onClick={() => handleClick("-")}
              >
                -
              </button>

              <button className="bg-tertiary py-1 px-4 border-0 rounded-md text-white text-2xl mb-2">
                =
              </button>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
